import React from 'react';

import {
   Paper, Card,
   CardMedia, CardContent, Grid
} from '@mui/material';

export default function Webcams(props) {
   return (
      <Grid item xs={12} sm={4}>
         {props.webcams.map(cam => {
            return (
               <Card sx={{
                  maxWidth: 350,
                  margin: '0.8rem',
               }}>
                  <CardMedia component='img'
                     image={cam.image}
                     alt='resort traffic webcam'>
                  </CardMedia>
                  <CardContent>
                     {cam.name}
                  </CardContent>
               </Card>
            )
         })}
      </Grid>
   );
}
